import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css'
import { useHistory } from 'react-router-dom';
import { Button } from 'react-bootstrap';


const Data = (props) => {
    const {category,img} = props.information

    const cardStyle={
        width: '18rem',
        maxWidth: 345,
        display: 'inline-block',
        margin: '10px',
        padding: '20px',
        marginLeft: '30px'
    }



    const history = useHistory()
    const handleRegister = (category) => {
        history.push(`/register/${category}`)

    }

    return (
        <div style={cardStyle}>
            <img style={{width:'250px'}} src={img} className="card-img-top" alt="..." />
            <Button onClick={()=> handleRegister(category)} className="btn btn-primary stretched-link btn-block">{category}</Button>
        </div>
    );
};

export default Data;
